const API_BASE_URL = process.env.REACT_APP_API_URL || "http://localhost:8000/api"

interface ApiConfig {
  baseURL: string
  headers: Record<string, string>
}

class ApiService {
  private config: ApiConfig

  constructor() {
    this.config = {
      baseURL: API_BASE_URL,
      headers: {
        "Content-Type": "application/json",
      },
    }
  }

  setToken(token: string) {
    this.config.headers["Authorization"] = `Bearer ${token}`
  }

  removeToken() {
    delete this.config.headers["Authorization"]
  }

  private async request<T>(endpoint: string, options: RequestInit = {}): Promise<T> {
    const url = `${this.config.baseURL}${endpoint}`
    const config: RequestInit = {
      ...options,
      headers: {
        ...this.config.headers,
        ...options.headers,
      },
    }

    const response = await fetch(url, config)

    if (!response.ok) {
      const error = await response.json().catch(() => ({ detail: "Network error" }))
      throw new Error(error.detail || `HTTP error! status: ${response.status}`)
    }

    return response.json()
  }

  // Auth endpoints
  async login(credentials: { email: string; password: string }) {
    return this.request("/auth/login/", {
      method: "POST",
      body: JSON.stringify(credentials),
    })
  }

  async register(userData: { first_name: string; last_name: string; email: string; password: string }) {
    return this.request("/auth/register/", {
      method: "POST",
      body: JSON.stringify(userData),
    })
  }

  async getProfile() {
    return this.request("/auth/profile/")
  }

  async updateProfile(data: any) {
    return this.request("/auth/profile/", {
      method: "PATCH",
      body: JSON.stringify(data),
    })
  }

  // Skills endpoints
  async getSkills(params?: any) {
    const queryString = params ? `?${new URLSearchParams(params).toString()}` : ""
    return this.request(`/skills/${queryString}`)
  }

  async getSkill(id: number) {
    return this.request(`/skills/${id}/`)
  }

  async createSkill(data: any) {
    return this.request("/skills/", {
      method: "POST",
      body: JSON.stringify(data),
    })
  }

  async updateSkill(id: number, data: any) {
    return this.request(`/skills/${id}/`, {
      method: "PATCH",
      body: JSON.stringify(data),
    })
  }

  async deleteSkill(id: number) {
    return this.request(`/skills/${id}/`, {
      method: "DELETE",
    })
  }

  async getCategories() {
    return this.request("/skills/categories/")
  }

  // Orders endpoints
  async getOrders() {
    return this.request("/orders/")
  }

  async getOrder(id: number) {
    return this.request(`/orders/${id}/`)
  }

  async createOrder(data: any) {
    return this.request("/orders/", {
      method: "POST",
      body: JSON.stringify(data),
    })
  }

  async updateOrder(id: number, data: any) {
    return this.request(`/orders/${id}/`, {
      method: "PATCH",
      body: JSON.stringify(data),
    })
  }

  // Points endpoints
  async getPointTransactions() {
    return this.request("/points/transactions/")
  }

  async purchasePoints(amount: number) {
    return this.request("/points/purchase/", {
      method: "POST",
      body: JSON.stringify({ amount }),
    })
  }

  async getPointsPackages() {
    return this.request("/points/packages/")
  }

  // Payments endpoints
  async getPaymentHistory() {
    return this.request("/payments/")
  }

  async createPayment(data: any) {
    return this.request("/payments/", {
      method: "POST",
      body: JSON.stringify(data),
    })
  }

  // Chat endpoints
  async getRooms() {
    return this.request("/chat/rooms/")
  }

  async getMessages(roomId: number) {
    return this.request(`/chat/rooms/${roomId}/messages/`)
  }

  async sendMessage(roomId: number, message: string) {
    return this.request(`/chat/rooms/${roomId}/messages/`, {
      method: "POST",
      body: JSON.stringify({ message }),
    })
  }
}

// Create singleton instance
const apiService = new ApiService()

// Export individual API services for backward compatibility
export const authAPI = {
  login: (credentials: { email: string; password: string }) => apiService.login(credentials),
  register: (userData: { first_name: string; last_name: string; email: string; password: string }) =>
    apiService.register(userData),
  getProfile: () => apiService.getProfile(),
  updateProfile: (data: any) => apiService.updateProfile(data),
}

export const skillsAPI = {
  getSkills: (params?: any) => apiService.getSkills(params),
  getSkill: (id: number) => apiService.getSkill(id),
  createSkill: (data: any) => apiService.createSkill(data),
  updateSkill: (id: number, data: any) => apiService.updateSkill(id, data),
