export const pointsAPI = {
  getTransactions: () => apiService.getPointTransactions(),
  purchasePoints: (amount: number) => apiService.purchasePoints(amount),
  getPackages: () => apiService.getPointsPackages(),
  getOrders: () => apiService.getOrders(),
}

export const paymentsAPI = {
  getPaymentHistory: () => apiService.getPaymentHistory(),
  createPayment: (data: any) => apiService.createPayment(data),
}

export const chatAPI = {
  getRooms: () => apiService.getRooms(),
  getMessages: (roomId: number) => apiService.getMessages(roomId),
  sendMessage: (roomId: number, message: string) => apiService.sendMessage(roomId, message),
}

// Export main service and set token method
export { apiService }
export const setAuthToken = (token: string) => apiService.setToken(token)
export const removeAuthToken = () => apiService.removeToken()

export default apiService
